The WASM indexer basically takes two sets of data types, one set coming from your sway contract, and the other defined in the form of a GraphQL schema, specifying how you would like your data to be indexed. The code you'll be writing will just transform the data from your contract types and inserts them into a database. With that in mind, let's start with a sample contract.json ABI spec: [ { "type":"contract", "inputs":[ { "name": "my_event", "type": "struct LogEvent", "components": [ { "name":"contract", "type":"b256" }, { "name":"event_id", "type":"u64" }, { "name":"count", "type":"u64" } ] } ], "name":"takes_struct", "outputs":[] }
] We have one type here, a LogEvent type, with a few attributes. This json will come from your sway contract, and defines the types you want to manipulate in WASM. As for the data structures defining your index, let's use this example: schema { query: QueryRoot
} type QueryRoot { event_counts: EventCount data2: SomeOtherData
} type EventCount { id: ID! account: Address! count: UInt8!
} type SomeOtherData { id: ID! hash: Bytes32!
} At a minimum, the schema needs a schema definition with the query type defined. In this example, they are defined at the top of the file. Now for the code! Fuel indexers use two proc macros to generate the rust types from these specifications. extern crate alloc;
use fuel_indexer_macros::{graphql_schema, handler};
use fuels_abigen_macro::wasm_abigen; graphql_schema!("hello_namespace", "schema/schema.graphql");
wasm_abigen!( no_name, "hello-indexer/contracts/hello_indexer.json"
); #[handler]
fn function_one(event: LogEvent) { Logger::info("Callin' the event handler"); let LogEvent { contract, event_id, count, } = event; let mut t1 = match EventCount::load(event_id) { Some(t) => t, None => EventCount { id: event_id, account: Address::from(contract), count: 0, }, }; t1.count += count; t1.save();
} function_one will take the ABI type LogEvent, unpack it into a few variables. It is attempting to load an EventCount type from the database with the id event_id, if it's not found it will create one. It will increment the count attribute either way and then save it back to the database. graphql_schema translates your graphql schema into rust types, so you can have access to them in your handler code. wasm_abigen will similarly translate the contract ABI types into rust types. handler is another macro that is required for the indexer to be accessible from the indexer service, it is mostly generates some glue code that bridges the interface between native code and the WASM runtime.

